270b76ac8b92eede4d84","avatar_decoration":null,"discriminator":"8050","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-06-08T17:45:40.308000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"851952807417348096","type":19,"content":"I have been a booker, I produced shows in 27 venues for 3 years before deciding to pursue my career in stand up. In that role, I didn't have time to watch hour long specials to decide if I wanted to book someone I hadn't seen before. I wanted three good jokes. If they were good enough, punchy enough with big laughs, then I sought out any of my regularly booked acts who may have worked with this new person and asked them what they thought. If it was positive, I gave them 2 slots at two different venues. The opportunity to succeed was offered and they either did or didn't. IF they did well, I booked them 20 more times. If they bombed both shows I had to assume it was because they were too green to book for pro shows and I didn't book them again for a couple years. Yes.... YEARS. So don't fuck it up. Do your time, be funny, don't be hard work, don't be a dick to the other acts, treat the gear with respect (no mic drops unless you are prepared to buy me another mic) and be kind to the venue staff and its patrons. Any act that could pull that off for my gigs was worth $10-$20 per minute of performance. In all honesty, the video/showreel/sizzle reel is really only a business card. If you like what you see, hit me up. As such, you should make sure you have good clear (preferably broadcast quality) footage as your source material, a clean intro and outtro with your contact details at the end so if they did like it they can call/email you.","channel_id":"842193547213144064","autho ave the best reaction to a particular joke. Dudes a genius.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-06-08T22:40:36.257000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"851956558123761754","type":0,"content":"I mean every big special is a compilation out of different recordings.","channel_id":"842193547213144064","author":{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-06-08T22:51:12.044000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"851956673118601256","type":0,"content":"But I gues not every EVERY netflix special. But its common that they record more than once. Jeselnik does it, others too.","channel_id":"842193547213144064","author":{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-06-08T22:51:39.461000+00:00","edited_timestamp":"2021-06-08T22:53:46.818000+00:00","flags":0,"components":[]},{"id":"851956784930750515","type":0,"content":"But i dont want to hijack your topic with a new topic ‚ù§Ô∏è ‚ù§Ô∏è","channel_id":"842193547213144064","author":{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258},"attachments":[],"embeds":[],"mentions":[],"mention_r _id":"842193547213144064","author":{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1cf69bd62af36981bdbc18c862043624","avatar_decoration":null,"discriminator":"6874","public_flags":512},"attachments":[],"embeds":[{"type":"video","url":"https://www.youtube.com/watch?v=E9zgXunIyWs","title":"Pitt St 07/28/2021","description":"Slow start and strong finish. 12-14 people in the crowd today so I was happy to get as many laughs as I did.","color":16711680,"author":{"name":"CR4ZY eyes","url":"https://www.youtube.com/channel/UCXGZGdXfWY1KBDjNxP0Rqfw"},"provider":{"name":"YouTube","url":"https://www.youtube.com"},"thumbnail":{"url":"https://i.ytimg.com/vi/E9zgXunIyWs/hqdefault.jpg","proxy_url":"https://images-ext-2.discordapp.net/external/MjaqEogf0FHoDgy-C9urZp2qZG12KABaUwNv7FEDtPE/https/i.ytimg.com/vi/E9zgXunIyWs/hqdefault.jpg","width":480,"height":360},"video":{"url":"https://www.youtube.com/embed/E9zgXunIyWs","width":1280,"height":720}}],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-07-29T18:04:41.791000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"870368236720488508","type":0,"content":"It was the best possible compliment to me when the comic I respect the most at my scene said to me \"do you realize how good you did tonight?\" I watched the video and it doesn't seem much different from other times I've been up but he's been doing it a lot longer and I don't know maybe he noticed something I don't pick up on.","channel_id":"842193547213144064","author":{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1cf69bd62af36981bdbc18c862043624","avatar_decoration":null,"discriminator":"6874","public_flags":512},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-07-29T18:12:38.294000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"870380664413892638","type":19,"content":"I‚Äôm a beginner but I love the way you‚Äôre flowing from subject to subject. It‚Äôs not just a poor written transition told like if you were a robot. It maybe written but there‚Äôs some subtle acting in it, like when you say ¬´¬†I do love my wife¬†¬ª and then move on to that subject. üëå","channel_id":"842193547213144064","author":{"id":"273736482974334977","username":"Herrmar","avatar":"88c77d309b1a1c728fa9046863d145e2","avatar_decoration":null,"discriminator":"2256","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1cf69bd62af36981bdbc18c862043624","avatar_decoration":null,"discriminator":"6874","public_flags":512}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-07-29T19:02:01.287000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"870368236720488508"},"referenced_message":{"id":"870368236720488508","type":0,"content":"It was the best possible compliment to me when the comic I respect the most at my scene said to me \"do you realize how good you did tonight?\" I watched the video and it doesn't seem much different from other times I've been up but he's been doing it a lot longer and I don't know maybe he noticed something I don't pick up on.","channel_id":"842193547213144064","author":{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1cf69bd62af36981bdbc18c862043624","avatar_decoration":null,"discriminator":"6874","public_flags":512},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-07-29T18:12:38.294000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"870381299486056479","type":0,"content":"Thanks! That‚Äôs something I learned from <@331232519737442305>","channel_id":"842193547213144064","author":{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1c ntent":"I think when you talk about movies or anything, the jokes requires sometimes too much information. If you mention movies or anything as a comedian, you should always rate how much common those movies are so u dont risk having a confused audience i gues.","channel_id":"842193547213144064","author":{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T01:00:03.311000+00:00","edited_timestamp":"2021-08-10T01:00:11.286000+00:00","flags":0,"components":[]},{"id":"874457528346484786","type":0,"content":"That's the issue I'm trying to balance...I'm trying to make these jokes so that you don't need to have heard of these movies to make them work, but it still requires some setup","channel_id":"842193547213144064","author":{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"discriminator":"9601","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T01:02:01.393000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874457617626460180","type":0,"content":"Since that act, I've further refined that stuff and replaced some weaker jokes with others","channel_id":"842193547213144064","author":{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"discriminator":"9601","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T01:02:22.679000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874457747792486430","type":0,"content":"If I can get a feed of my show for the festival, I'll totally post it here","channel_id":"842193547213144064","author":{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"discriminator":"9601","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T01:02:53.713000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874457830416085024","type":0,"content":"you will figure it out!","channel_id":"842193547213144064","author":{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T01:03:13.412000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874616618435608627","type":19,"content":"Dude, you need to be waaaaaay more ruthless trimming your material. That first joke took 1 min 12 sec to tell. I've trimmed it down to the key points 'Theres a trend with the commercials for erectile dysfunction where the people in the ads are getting younger and younger. It used to be elderly couples, then it was middle aged couples and now... its couples in their mid thirties! How much worse is it going to get? Fratboy Chad wants to bone Katie from the Tridells but she's gone off with Kevin because he's spoken to his doctor about staxinol!?' which I can tell in under 25 seconds. The way you're presenting your material has a lot of unnecessary fill. Rhetorical questions, statements that add nothing to the punchline working. Its like you've had the idea for the joke based on an observation, then written it out, but not edited it down. Perhaps you've never been shown? The process is quite simple. Write out your joke in full, as you intend to perform it on stage. Take a highlighter and mark the big punchline you plan to end it on. Now look at your first sentence, say your joke out loud, without the first sentence, does the punchline still work? If it does - you dont need that first sentence. Eliminate it. If the punchline doesnt work without the first sentence, then its critical and you have to keep it. Do the same thing with each sentence before the punchline, keeping the critical and eliminating anything that doesnt need to be there. Thats phase one.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"discriminator":"9601","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T11:34:11.426000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"874456378465464341"},"referenced_message":{"id":"874456378465464341","type":0,"content":"<@!215162686801969152> Well, I was doing open mics at another place, until I was referred to this place for a tryout...the guy who booked me liked me, but said that before I can get booked there on a regular basis, I need to trim the fat off my jokes","channel_id":"842193547213144064","author":{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"discriminator":"9601","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T00:57:27.240000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"874617760376840202","type":0,"content":"Phase two, is taking each of those critical sentences before the punchline and seeing if you can say exactly the same thing in fewer words and still have the punchline work.  eg. Here's a story about my friend Dave, (he's a plumber in his late fiftiies) and the time he met Mike (a successful car salesman) and his boss Steve (late 40's and gay) for a drink at a local Irish pub.' The entire set up can be replaced with 'Three guys walk into a bar....'  The ages and occupations have nothing to do with building all the setup an audience requires to understand whats going on.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T11:38:43.686000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874618416365961266","type":0,"content":"Phase three is then going through the joke and seeing if there are funnier phrases that could be used instead of, in the case of your joke - is it funnier to say '...ads for erectile dysfunction' or 'boner pill ads' - you'll need to test both versions of the joke in front of an audience to be certain. Thats what open mikes are for. Testing the subtle changes you have employed to see which version of your joke is funnier, in addition to seeing what material works and what doesnt.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T11:41:20.086000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874619324600573973","type":0,"content":"Phase four is then to go through the material you've just crafted, look for verbs to add in appropriate actions or gestures to provide a visual representation for whats happening in the story and look for nouns that you can use as a springboard to include potential puns and up your laugh rate per minute. New acts starting out should be aiming for 4-6 laughs per minute. Pro's like such as Robin Williams, Bill Burr etc generally hit 10-16 laughs per minute (on average over the course of an hour) which is too hard to hit when you only have 5 minutes to play with.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T11:44:56.626000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874621384758820884","type":0,"content":"If you've read this far, then maybe you'll go to phase five, which is then looking at the import of each sentence and experimenting with body position, facial expression, vocal technique and mic technique. For instance, in the rewrite Ive offered of your first joke 'Fratboy Chad wants to bone Katie from the Tridells but she's gone off with Kevin because he's spoken to his doctor about staxinol!?' is it funnier to instead become Chad and tell the story using a voice/attitude and tell the audience what has happened from a first person perspective rather than the third person perspective perhaps while on the phone to his father? 'Dad.... its Chad... college is ok... but I'm having trouble.... Well.... I wanted to bone Katie from the Tridells but she went off with Kevin because he;s spoken to his doctor about Staxinol....' Hitting the punchline in first person would also allow tag lines such as 'What do you mean you highly recommend it?' 'Wait Mom recommends it?' etc etc.- experiment. See what works for you.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T11:53:07.806000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":"592794625530527746","name":"vote"},"count":1,"me":false}]},{"id":"874691301252145192","type":0,"content":"Thank you for all the advice...I did trim down a lot for my next performance...I removed a lot of what didn't work","channel_id":"842193547213144064","author":{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"discriminator":"9601","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-08-10T16:30:57.197000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"874738563365883964","type":0,"content":"<@!368838282294984724> I watched your set. I've done that same show before, the Industry Room. It can lead to other opportunities, but it takes some time to get there. I think the first half was solid and you got some good laughs, I feel like the 2nd half tapered off a bit and the crowd seemed to be talking a bunch, I think it's just a matter of trimming the fat for those bits.","channel_id":"842193547213144064","author":{"id":"265943669528330241","username":"emaxsaun","avatar":"909cec854306fef7b599144b0b32daae","avatar_decoration":null,"discriminator":"9984","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"368838282294984724","username":"thematt523","avatar":"2852d0b1fd192687e82392460ef243ea","avatar_decoration":null,"disc ent voice and good movement and flow emphasizing different elements of the bits, creates a good pace and easy conversational flow. Its really solid. Good work. There are a few pointers I'd like to offer, try to avoid putting rhetorical questions into your routines. If you don't need an answer from the audience, you dont need to ask the question. There is work to be done trimming the fat from the jokes and sharpening them a little more. Your opening bit - 'Give it up for your host you guys...yes... oh my goodness.... Uhh so a little bit about me I actually am a born and raised Floridian. Some of y'all probably already guessed that because I have that face that screams 'Walmart Shopper\". which takes 21 seconds to get to that first laugh.  You can dispense with 'Give it up for your host', you have a very limited time to test your material, no one is going to hassle you for diving straight in. Instead consider starting with 'I'm a born and raised Floridian, you can tell by my generic 'Walmart Shopper' face.' Same joke, just told 16 seconds faster. If you can shave that amount of time off ten jokes in your routine, thats 2 mins 40 seconds extra you have to test run more material üòÑ","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"358773344327303168","username":"bigadamo","avatar":"93cfd69df68ad6942e2c3a71264a29e3","avatar_decoration":null,"discriminator":"0016","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-02T00:27:52.936000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"882595404112334880"},"referenced_message":{"id":"882595404112334880","type":0,"content":"https://youtu.be/Z_XB6xhK9b0","channel_id ar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-02T23:54:46.838000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"883140876820430858","type":19,"content":"I would love some!","channel_id":"842193547213144064","author":{"id":"358773344327303168","username":"bigadamo","avatar":"93cfd69df68ad6942e2c3a71264a29e3","avatar_decoration":null,"discriminator":"0016","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-03T00:06:32.998000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"883137914970734594"},"referenced_message":{"id":"883137914970734594","type":0,"content":"The only way to stop that is to learn the material better. I can give you tips for that if you like?","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-02T23:54:46.838000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"883147064924590200","type":0,"content":"Hand write each joke out, in full as you would say it on stage. Take a highlighter and highlight which part of the joke you expect people to laugh at. Is the big payoff at the end of the joke? If its not, then you may need to reorganise the joke so that the big payoff is at the end, so play with moving the sentences around until it fits. Once its arranged, look at each sentence prior to the punchline, if you got rid of it, would the punchline work? If it the punchline doesnt work, there must be critical information in there, so it has to stay. Do the same with each sentence to see what you need in there and what you dont. Keep what you need for the joke to work, eliminate that which doesn't.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-03T00:31:08.357000+00:00","edited_timestamp":null,"flags":32,"components":[],"thread":{"id":"883147064924590200","guild_id":"514967871823020053","parent_id":"842193547213144064","owner_id":"528148673893236736","type":11,"name":"great exercise tip","last_message_id":"886598349317349387","thread_metadata":{"archived":true,"archive_timestamp":"2021-09-13T13:13:20.722000+00:00","auto_archive_duration":1440,"locked":false},"message_count":30,"member_count":1,"rate_limit_per_user":0,"flags":0,"total_message_sent":30,"member_ids_preview":["528148673893236736"]},"reactions":[{"emoji":{"id":"592794625530527746","name":"vote"},"count":3,"me":false},{"emoji":{"id":null,"name":"üíØ"},"count":1,"me":false}]},{"id":"883147547860930591","type":0,"content":"Once youve done that, go through each sentence again, but see if you can say more or less the same thing, in fewer words, and have the punchline still work.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-03T00:33:03.498000+00:00","edited_timestamp":null,"flag nsive and your voice is the vocal equivalent of a resting bitch face. Don't take ANY of this to heart, we all start somewhere and even the greatest acts all universally sucked when they started. So, for your next performance, dress to impress, put some effort in to looking good on stage. If you look good on stage, the jokes work better because people are more inclined to pay more attention to a person who looks like an entertainer rather than someone who wandered up on stage having hauled themselves out of a beanbag because they'd run out of Cheetos. Greet the audience like an old friend, say hello, tell them how good it is to be there - and mean it! Be friendly and deliver your material like you know its already going to work - and it will. Showing the audience you are confident, gives them confidence in you. Having the confidence from the audience allows you to feel more confident. You have embarked upon a learning journey where you will one day stand shoulder to shoulder with the GODS of entertainment. Be excited! One day, you'll travel the world, fuck models and dine upon the rarest of delicacies! You have so much to look forward to üòÑ","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"344337464002871297","username":"Conner42","avatar":"b58471f0b57f6434d45db14c3ef4df79","avatar_decoration":null,"discriminator":"8197","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-09T01:55:36.731000+00:00","edited_timestamp":"2021-09-27T12:45:07.119000+00:00","flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"885206565454503936"},"referenced_message":{"id":"885206565454503936","type":0,"content":"https://m.youtube.com/watch?v=xuVWjfWyWZA","channe ive and your voice is the vocal equivalent of a resting bitch face. Don't take ANY of this to heart, we all start somewhere and even the greatest acts all universally sucked when they started. So, for your next performance, dress to impress, put some effort in to looking good on stage. If you look good on stage, the jokes work better because people are more inclined to pay more attention to a person who looks like an entertainer rather than someone who wandered up on stage having hauled themselves out of a beanbag because they'd run out of Cheetos. Greet the audience like an old friend, say hello, tell them how good it is to be there - and mean it! Be friendly and deliver your material like you know its already going to work - and it will. Showing the audience you are confident, gives them confidence in you. Having the confidence from the audience allows you to feel more confident. You have embarked upon a learning journey where you will one day stand shoulder to shoulder with the GODS of entertainment. Be excited! One day, you'll travel the world, fuck models and dine upon the rarest of delicacies! You have so much to look forward to üòÑ","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"344337464002871297","username":"Conner42","avatar":"b58471f0b57f6434d45db14c3ef4df79","avatar_decoration":null,"discriminator":"8197","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-09T01:55:36.731000+00:00","edited_timestamp":"2021-09-27T12:45:07.119000+00:00","flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"885206565454503936"}}},{"id":"885351057369231492","type":0,"content":"Youre welcome, and thank you for your candor. It can be difficult hearing things arent good, but you learn more from it than just patting you on the back and saying 'Good job'. people are far too concerned with being polite than being honest. You can write a joke. That is only half the job, you now have to perform that joke and really sell it to the audience. If a 'salesman' came to my door, dressed in track pants and sneakers, wasn't confident in the product and when talking to me was defensive (like I had already said 'No'.) I wouldn't buy the product. You're the salesman, the jokes are the product youre selling to your customer, the audience. So look the part, speak the part and soon you'll have the customer coming to you üòÑ","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-09T02:29:01.104000+00:00","edited_timestamp":"2021-09-09T02:29:28.871000+00:00","flags":0,"components":[]},{"id":"885351651836305548","type":0,"content":"I keep getting different comments from how I come off as on stage so this is the first time someone really explained it to me in this way","channel_id":"842193547213144064","author":{"id":"344337464002871297","username":"Conner42","avatar":"b58471f0b57f6434d45db14c3ef4df79","avatar_decoration":null,"discriminator":"8197","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-09-09T02:31:22.836000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"885352254243242006","type":0,"content":"Your Cheetos joke made me laugh, that was a good roast üòÇ","channel_id":"842193547213144064","author":{"id":"344337464002871297","username":"Conner42","avatar":"b58471f0b57f6434d45db14c3ef4df79","avatar_decoration":null,"discriminator":"81 :null,"discriminator":"9331","public_flags":256},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-10-26T21:27:35.292000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"902786880670691358","type":0,"content":"Its pretty good dude, there a couple of minor tics you have which will work out over time as you develop your voice and onstage persona. Keep going, take all of the jokes you performed in this set and see if you can write three different punchlines for each bit, then perform them and see which lines get bigger laughs.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-10-27T05:12:45.321000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"902795898382323752","type":0,"content":"Just so youre not sitting there freaking out about 'What tics...????' By tics I mean you have a tendency to pause when you're trying to remember your next 'bit', the segueways youre using are a little long for the bits and your delivery while strong - is not yet relaxed. When you start having fun and not worrying about making a mistake, the routines will be stronger and waaaay more confident. What you are doing really well is great eye contact with the audience, no fear in speaking to the audience directly which is a solid beginning to develop strong crowd work skills and the material is well written. Of course all writing could use more development, your test is to write more punchlines for each joke premise.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_ 93547213144064","guild_id":"514967871823020053","message_id":"888442723877650512"},"referenced_message":null},{"id":"908198619021209651","type":0,"content":"Definitely never using the Hoardin‚Äô Hears a Who joke ever again lol\n\nhttps://youtu.be/bURZmnsKg8A","channel_id":"842193547213144064","author":{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1cf69bd62af36981bdbc18c862043624","avatar_decoration":null,"discriminator":"6874","public_flags":512},"attachments":[],"embeds":[{"type":"video","url":"https://www.youtube.com/watch?v=bURZmnsKg8A","title":"Pitt St 11/10/2021","description":"Hosting tonight so take it for what it is. Feedback is welcomed but ignored.","color":16711680,"author":{"name":"CR4ZY eyes","url":"https://www.youtube.com/channel/UCXGZGdXfWY1KBDjNxP0Rqfw"},"provider":{"name":"YouTube","url":"https://www.youtube.com"},"thumbnail":{"url":"https://i.ytimg.com/vi/bURZmnsKg8A/hqdefault.jpg","proxy_url":"https://images-ext-2.discordapp.net/external/qq54W-rgz9UPzpxdFrX8fHKn3_OD4F_1Cl3xYr7BZ_Y/https/i.ytimg.com/vi/bURZmnsKg8A/hqdefault.jpg","width":480,"height":360},"video":{"url":"https://www.youtube.com/embed/bURZmnsKg8A","width":1280,"height":720}}],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-11-11T03:37:04.289000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":null,"name":"üòÜ"},"count":2,"me":false}]},{"id":"908220182374268938","type":0,"content":"If you're hosting again, try to do some crowd work to establish who you have in the room, look for groups (there will usually be someone that will elect themselves as spokesperson for the entire group) Crowd work is easy if you approach it the same way you would a normal conversation with someone youve just met. \"Hey! So how are things going? What do you do again? Married...? This your partner? Are you celebrating tonight?\" etc etc all good ice breakers. You spent 38 seconds breaking down trhe format of the show before diving straight into material, you started with a story gag but I think three quick one liners would have got the crowd more energetic, particularly if you could make those one liners about the people you see in the audience. Your first gag in this instance was about working at a University, so play with the audience a little and turn the conversation towards that first joke. There are plenty of ways to get there and make it seem like youre telling the story off the cuff rather than preprepared. Hey! So how are things going? What do you do again? Really - I work at a University...' etc etc.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-11-11T05:02:45.393000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":null,"name":"üëç"},"count":4,"me":false}]},{"id":"908320119770456094","type":0,"content":"That‚Äôs great advice, thanks!","channel_id":"842193547213144064","author":{"id":"286659977156755466","username":"CR4ZYeyes","avatar":"1cf69bd62af36981bdbc18c862043624","avatar_decoration":null,"discriminator":"6874","public_flags":512},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-11-11T11:39:52.325000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"908466324278235146","type":0,"content":"I saw this guy do crowd work over a year. He started asking people for their favourite animal. By the end of the year he had a zippy response for every animal, and it looked off the cuff. Penguin? That's just a man in a suit. Horse? That's two men in two different suits! Snake? That's just a lizard without legs. And so on. \nI think the moral was, if you your moms eyes while you fuck her.  Besides the dirty shock, where's the cleverness here?  Be honest with yourself.\n\nYou seem like a funny guy.  You had some good bits there.  I just think that if you are seriously thinking about submitting to bookers you will want to show a different side of yourself.  Can you do 5-10 minutes of material that isn't shock/dirty?","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T00:03:42.027000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"917574055001993216","type":19,"content":"I can‚Äôt do 5-10 minutes clean because I haven‚Äôt really tried. I don‚Äôt really know if I would want too. But I do appreciate your feedback.","channel_id":"842193547213144064","author":{"id":"817634345077571595","username":"Colfax","avatar":"ba9a97bfd2c4dea12b081c34b3456a9f","avatar_decoration":null,"discriminator":"9946","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T00:31:42.414000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"917567006948093962"},"referenced_message":{"id":"917567006948093962","type":0,"content":"So here's my honest feedback.  \nI assume you came here for more than people blowing smoke up your ass.  Constructive criticism is important and helps you, I hope that you take my thoughts not as a slam against you, but as a different perspective.\nFor 30 times on stage your delivery still seems a bit timid and there is obvious nervousness.  All of that is normal, but I would suggest trying to speak a little less soft spoken, feels like you are holding back a bit and that goes a long way with stage presence.\nAs far as material goes.  Much of it is that shock value, crude, dirty type of stuff, most of which I thought lacked  some depth.  It's possible to do that and still be smart with depth i.e. Louis CK.  So you don't have to be clean to succeed.  But you also shouldn't rely on cheap laughs from drunk women to drive your material.\nYou look in your moms eyes while you fuck her.  Besides the dirty shock, where's the cleverness here?  Be honest with yourself.\n\nYou seem like a funny guy.  You had some good bits there.  I just think that if you are seriously thinking about submitting to bookers you will want to show a different side of yourself.  Can you do 5-10 minutes of material that isn't shock/dirty?","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T00:03:42.027000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"917575603169935370","type":0,"content":"In all fairness I said I look my mother in the eyes when I fuck her, and then went on about how I was in Tennessee doing this show so I was trying to ‚Äúrelate to my audience‚Äù","channel_id":"842193547213144064","author":{"id":"817634345077571595","username":"Colfax","avatar":"ba9a97bfd2c4dea12b081c34b3456a9f","avatar_decoration":null,"discriminator":"9946","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T00:37:51.526000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"917578013170868254","type":19,"content":"What other jokes do you think lacked depth?","channel_id":"842193547213144064","author":{"id":"817634345077571595","username":"Colfax","avatar":"ba9a97bfd2c4dea12b081c34b3456a9f","avatar_decoration":null,"discriminator":"9946","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T00:47:26.115000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"917567006948093962"},"referenced_message":{"id":"917567006948093962","type":0,"content":"So here's my honest feedback.  \nI assume you came here for more than people blowing smoke up your ass.  Constructive criticism is important and helps you, I hope that you take my thoughts not as a slam against you, but as a different perspective.\nFor 30 times on stage your delivery still seems a bit timid and there is obvious nervousness.  All of that is normal, but I would suggest trying to speak a little less soft spoken, feels like you are holding back a bit and that goes a long way with stage presence.\nAs far as material goes.  Much of it is that shock value, crude, dirty type of stuff, most of which I thought lacked  some depth.  It's possible to do that and still be smart with depth i.e. Louis CK.  So you don't have to be clean to succeed.  But you also shouldn't rely on cheap laughs from drunk women to drive your material.\nYou look in your moms eyes while you fuck her.  Besides the dirty shock, where's the cleverness here?  Be honest with yourself.\n\nYou seem like a funny guy.  You had some good bits there.  I just think that if you are seriously thinking about submitting to bookers you will want to show a different side of yourself.  Can you do 5-10 minutes of material that isn't shock/dirty?","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T00:03:42.027000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"917799251977850930","type":0,"content":"You said that you don't know if you would want to do 5 minutes of clean material.  To me that's a narrow vision and that you are fixated on trying to be edgy or dirty or whatever.  Once again, not necessarily anything wrong with that.  There are comedians who are successful with that style.  Not everyone has to be cruise boat or corporate safe.  But that gets back to the depth of what you are doing.  And without depth and versatility, in my opinion you are going to have some trouble getting booked outside of open mics.  Plus 10-15 minutes is one thing, but a comic headlining 45 minutes with short, dirty bits gets a bit tiring for many.  You should try to structure your set a little better too, to help with flow.  Try to tie some similar ideas together to get some cohesive chunks of comedy.  I think an audience is more likely to go along with you if you are working under an umbrella of some larger themes.","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T15:26:33.557000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":null,"name":"üëç"},"count":1,"me":false}]},{"id":"917799372702490665","type":0,"content":"My notes on your set:\n\nAlec Baldwin- fine joke, but it‚Äôs a one time deal and outdated now.\n\nEpstein Halloween - kind of flat\n\nSchool shooting - one of your better bits I thought, but I think you could do even more there as part of a bigger chunk either on shootings or racial material.\n\nTinder Date - needs more.  A tinder date sucks your dick in the parking lot.  Ok‚Ä¶ but what else?  The tag about your car was funny.\n\nHaven‚Äôt fucked in a while - once again, you are saying that you can cum just from looking into a girls eyes.  Ok, and?  You do the tag about ordering in restaurants, but it still all seems very one note.  \n\nI love jerking off - the switcheroo with YMCA shower is honestly a bit hack and I‚Äôm almost sure I‚Äôve heard this similar bit before many different ways.","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T15:27:02.340000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":null,"name":"üëç"},"count":1,"me":false}]},{"id":"917799384933105744","type":0,"content":"Dog the Bounty Hunter - I got the joke and reference, but I also thought this was flat and another one that is quickly dated.\n\nRape Fantasy - I feel the crowd didn‚Äôt even go all the way along with this one to end, you seemed to have exhausted the bit.  It seems like you had an idea there, but were having a hard time making it funny.  ETSU alumni, Rodney Dangerfield, etc. none of it really expressed your idea funny imo.  I get the idea you were trying to do,  maybe play around with it more to try to see if another angle works on that one.\nI think there is something funny there, just didn‚Äôt flow well.\n\nMother looks me in the eyes when we fuck - I had to watch it back to see the part where you said you were trying to relate to the Tennessee audience, it was hard to hear.  Still seemed just cheap for me.  And will that same line work other places?  Would that work in NYC?\n\nAfghanistan- I didn‚Äôt feel this was a good comparison to eventually slam a college football team.  Maybe it works in this crowd because of the location, but don‚Äôt see how this is a keeper for a general audience.\n\nFemale Genital Mutilation - in effect the punchline is that the best way to punish a women is to fuck you.  It‚Äôs just not an original take.","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T15:27:05.256000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":null,"name":"üíØ"},"count":1,"me":false}]},{"id":"917799430604861491","type":0,"content":"I am just one person giving an opinion.  You should get feedback from many different sources.  I could very well not know what I‚Äôm talking about.  You had some good premises in there and I think you know how to write jokes.  But maybe just try to take it up a notch, bigger ideas, flesh out stuff a little more past the shock laughs or taboo subjects.","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T15:27:16.145000+00:00","edited_timestamp":null,"flags":0,"components":[],"reactions":[{"emoji":{"id":null,"name":"üêê"},"count":1,"me":false}]},{"id":"917893440782598194","type":19,"content":"I saw your request for feedback and then saw Carlos had already offered, so I let him take the lead here. Nothing he has made mention of above is imo incorrect, I agree 100% and if Im truly honest I think he's sugar coated his response a little as I would have been waaaaay more blunt with my feedback.  All in all, there are issues with order, content, style, onstage persona, none of it sounded plausably true.  You have some skill in writing material, but youve gone for the lowest hanging most obvious fruit and not explored what other fruit the *idea tree* may yield. When you have a premise, try to write 10 punchlines for that premise, if you just go with the first punchline you come up with, I guarantee you its the first punchline other acts will come up with and the first punchline the audience will predict. When I'm in the audience, I want to connect with the comedian, I want to know who they are, what they're about. The only way to do that is if the comedian is honest in their thoughts and presentation of their material. You are still hiding behind this made up persona of what you think you should sound like 'if' you were a comedian. This is the attitude you should have 'if' you were a comedian. This is the material you should shock people with 'if' you were a comedian. I'm giving you this feedback... ***You are a comedian. Now tell us about what you think about anything and everything and show us who you are.***","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"817634345077571595","username":"Colfax","avatar":"ba9a97bfd2c4dea12b081c34b3456a9f","avatar_decoration":null,"discriminator":"9946","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T21:40:49.918000+00:00","e w your request for feedback and then saw Carlos had already offered, so I let him take the lead here. Nothing he has made mention of above is imo incorrect, I agree 100% and if Im truly honest I think he's sugar coated his response a little as I would have been waaaaay more blunt with my feedback.  All in all, there are issues with order, content, style, onstage persona, none of it sounded plausably true.  You have some skill in writing material, but youve gone for the lowest hanging most obvious fruit and not explored what other fruit the *idea tree* may yield. When you have a premise, try to write 10 punchlines for that premise, if you just go with the first punchline you come up with, I guarantee you its the first punchline other acts will come up with and the first punchline the audience will predict. When I'm in the audience, I want to connect with the comedian, I want to know who they are, what they're about. The only way to do that is if the comedian is honest in their thoughts and presentation of their material. You are still hiding behind this made up persona of what you think you should sound like 'if' you were a comedian. This is the attitude you should have 'if' you were a comedian. This is the material you should shock people with 'if' you were a comedian. I'm giving you this feedback... ***You are a comedian. Now tell us about what you think about anything and everything and show us who you are.***","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"817634345077571595","username":"Colfax","avatar":"ba9a97bfd2c4dea12b081c34b3456a9f","avatar_decoration":null,"discriminator":"9946","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T21:40:49.918000+00:00","edited_timestamp":null,"flags":0,"components" _flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-10T21:29:42.412000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"917009415192850442"},"referenced_message":{"id":"917009415192850442","type":19,"content":"The thing to remember is that youre always going to be at your best when youre charming on stage. The audience is judging you on how you look, how you dress, the manner of your speech announces how educated you are & provides an estimation of your general intelligence. The fake flowers on the graves of dead relatives needs a comparison to cap it off. E.g. ***Putting fake flowers on the graves of dead relatives feels disrespectful, like getting your grandfathers war medals valued - before he's died, its ok he '*claims*' he doesn't even remember being in the war... and killing all the jewish people....*** (thats probably too far - but you see my point). Something like this adds extra layers to the bit, the premise is how deeply you feel disrespectful, then double down by getting grandads medals valued before he's died as being way more disrespectful, but then a third level is revealed where he **claims** he doesn't remember killing all those jewish people provides subtext that he actually does remember but is trying to hide his involvement and also reveals (surprise!) that he fought for the Germans making the second bit about valuing his medals before his death not as bad as what Grandad did! Any time you have the opportunity to build a bit, then provide subtext (a B story to the bit) then pull the rug out from under everyone and blindside them, youre on to a cracking bit, that may end up being built into a routine.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_ bed/bxw2k8ED3fI","width":406,"height":720}}],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-11T18:57:58.442000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"919302053250072596","type":0,"content":"In Portuguese but requested by some people","channel_id":"842193547213144064","author":{"id":"158571612965306368","username":"Ayo wtf","avatar":"8e454b02cebe39b2c7b0e6083136f371","avatar_decoration":null,"discriminator":"1360","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-11T18:58:09.301000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"919518872107880478","type":19,"content":"When you say clean material, are you talking about material that could be aired on TV? People have told me I'm definitely not an edgy comedian but I have some bits that couldn't be aired on TV because they involve curse words (being said by my students)","channel_id":"842193547213144064","author":{"id":"344337464002871297","username":"Conner42","avatar":"b58471f0b57f6434d45db14c3ef4df79","avatar_decoration":null,"discriminator":"8197","public_flags":0},"attachments":[],"embeds":[],"mentions":[{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-12T09:19:42.945000+00:00","edited_timestamp":null,"flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"917799251977850930"},"referenced_message":{"id":"917799251977850930","type":0,"content":"You said that you don't know if you would want to do 5 minutes of clean material.  To me that's a narrow vision and that you are fixated on trying to be edgy or dirty or whatever.  Once again, not necessarily anything wrong with that.  There are comedians who are successful with that style.  Not everyone has to be cruise boat or corporate safe.  But that gets back to the depth of what you are doing.  And without depth and versatility, in my opinion you are going to have some trouble getting booked outside of open mics.  Plus 10-15 minutes is one thing, but a comic headlining 45 minutes with short, dirty bits gets a bit tiring for many.  You should try to structure your set a little better too, to help with flow.  Try to tie some similar ideas together to get some cohesive chunks of comedy.  I think an audience is more likely to go along with you if you are working under an umbrella of some larger themes.","channel_id":"842193547213144064","author":{"id":"906965000390864947","username":"Carlos Cruz","avatar":"d353db32b18b2a856b5dd77ffb37cb5a","avatar_decoration":null,"discriminator":"5606","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2021-12-07T15:26:33.557000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"919684088259026984","type":0,"content":"I did a show where the comics would have to take shots, then do timed material, it was called SLOSHED, it was fun - https://www.youtube.com/watch?v=bMzjLpJs3E0","channel_id":"842193547213144064","author":{"id":"265943669528330241","username":"emaxsaun","avatar":"909cec854306fef7b599144b0b32daae","avatar_decoration":null,"discriminator":"9984","public_flags":0},"attachments":[],"embeds":[{"type":"video","url":"https://www.youtube.com/watch?v=bMzjLpJs3E0","title":"Ethan Feldman is SLOSHED","description":"Ethan Feldman is SLOSHED","color":16711680,"author":{"name":"emaxsaun","url":"https://www.youtube.com/channel/UCVahvrBZ60X_nXN4kpAxf-g"},"provider":{"name":"YouTube","url":"https://www.youtube.com"},"thumbnail":{"url":"https://i.ytimg.com/vi/bMzjLpJs3E0/maxresdefault.jpg","proxy_url":"https://images-ext-2.di alse,"mention_everyone":false,"tts":false,"timestamp":"2022-01-06T09:37:59.555000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"928974177317294121","type":0,"content":"Strong confident delivery, which is good. I don't know if Id open with 'Stinky Butthole' - I know you like the joke, but its more a middle of the routine rather than the beginning or the end, consider losing wearing the baseball cap on stage, you look down a few times and it puts a dark shadow over your eyes so the audience loses eye contact with you and it can break focus if done too often. Use your non mike hand to make gestures, you leave it swinging about like you don't know what to do with it. The tracing dicks gag is gold, I recall having a conversation with you a few months ago where that line came up, the lead in is longer than it needs to be, rather than binge drinking with your friends, just ask the rhetorical question; 'Ever woken up after a party and some asshole has drawn baby dicks on your face? And the smell of your own beard leaves you thinking they may have traced that dick?' Its just a speedier way to get into the bit and use it to launch into other bits you may have tucked away that involve the keywords, such as party, dicks, smells, beards etc. Grandma gag needs a bigger finish than 'browsing my reddit' that bit feels like its a stepping stone tag line into a bigger punchline. So maybe make it bigger and more shocking, 'Grandma if you were 30 years younger you'd be 61! What do you think I'm into? Have you been browsing my reddit history? Did you find the camera I hid in your shower?' (as an example). All in all, I really liked it. It could be tweaked and tightened up a little, but the improvised elements are nice and gives it a little breathing room, there are moments in the performance of storytelling that sound like Ryan Reynolds telling an anecdote, which is fine, you have a similar energy/vocal inflexion when you're having fun.","channel_id":"8421935472131440 4064/933430203110273074/set_12_10_21.mp4","width":640,"height":360,"content_type":"video/mp4"}],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-01-19T18:38:23.427000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"933706163449626724","type":0,"content":"<@170702689531854848> nice one","channel_id":"842193547213144064","author":{"id":"215162686801969152","username":"WillMcfly","avatar":"85d88c3a07b4b0f2048cae54438d6544","avatar_decoration":null,"discriminator":"0001","public_flags":258},"attachments":[],"embeds":[],"mentions":[{"id":"170702689531854848","username":"JDude","avatar":"8be6b5b8ac78267e7f7e29be32f2e26a","avatar_decoration":null,"discriminator":"9331","public_flags":256}],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-01-20T12:54:56.788000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"933714895160102942","type":19,"content":"Well rehearsed set, no umm's or uhh's I think we spoke about the Goldfish joke back in September last year, worked well in this set (I didn't quite understand it as we don't have Goldfish crackers here). Looking at your set construction, you had 5 laughs in the first minute, 5 again in the second, 4 laughs in the third, 6 laughs in the fourth minute and only one laugh in the final 49 seconds with the 'orphan' gag. This gives you an average laugh rate per minute of around 4.5 and it shows where the routine is strong and where it is not so strong. The orphan joke has a big pay off, but the build up is quite long without any other jokes in there. This is meant to be the big finale and could use a little further editing to tighten it up more, You asked a question of the audience with that joke 'How many lives do you think Batman has saved?\" The audience then called out everything from 'None' to 'Twelve!' and when you didn't get the answer you wanted (1000) you told them the number you needed. If you are going to ignore the answers the audience calls out - you might as well not ask the question - and just tell the audience 'Batman must have saved at least a thousand people....' and get into the bit. Asking rhetorical questions just slows the pace of your delivery.","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-01-20T13:29:38.590000+00:00","edited_timestamp":"2022-01-20T13:35:25.888000+00:00","flags":0,"components":[],"message_reference":{"channel_id":"842193547213144064","guild_id":"514967871823020053","message_id":"933430206092419102"},"referenced_message":{"id":"933430206092419102","type":0,"content":"Did this set last month, but finally got my hands on the video. Any feedback is greatly appreciated!","channel_id":"842193547213144064","author":{"id":"170702689531854848","username":"JDude","avatar":"8be6b5b8ac78267e7f7e29be32f2e26a","avatar_decoration":null,"discriminator":"9331","public_flags":256},"attachments":[{"id":"933430203110273074","filename":"set_12_10_21.mp4","size":24413478,"url":"https://cdn.discordapp.com/attachments/842193547213144064/933430203110273074/set_12_10_21.mp4","proxy_url":"https://media.discordapp.net/attachments/842193547213144064/933430203110273074/set_12_10_21.mp4","width":640,"height":360,"content_type":"video/mp4"}],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-01-19T18:38:23.427000+00:00","edited_timestamp":null,"flags":0,"components":[]}},{"id":"933717405048406066","type":19,"content":"You delayed your start to the show with commentary like 'There are a lot of fucking people here tonight' etc. and as a result you spent your first 30 seconds on stage not telling the joke.  The timestamp":null,"flags":0,"components":[]},{"id":"948889357178249217","type":0,"content":"I've headlined throughout the UK, whoever told you that has put you crook","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:27:32.263000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948889383988244550","type":0,"content":"Hah, fair","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:27:38.655000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948889560245473311","type":0,"content":"Who are you working with at the moment?","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:28:20.678000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948889742613827626","type":0,"content":"As in agent?","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:29:04.158000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948889761626599475","type":0,"content":"Or writer?","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:29:08.691000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948890202145972234","type":0,"content":"I meant clubs, but sure... have you got an agent? I was with Jon Keyes at Paramount (he organised the work visas)","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:30:53.719000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948890672000286730","type":0,"content":"Not really. Have performed at a few, but wasn't ready to make that jump. Finally got to a level where I felt more confident and the pandemic hit. Managed to improve even more over the last 2 years where I could and also got a car to drive to more gigs. I've not got an agent, but working on a solo show that I'll be taking to Edinburgh this year and next year to get as much press as I can, as well as other comedy festivals","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:32:45.741000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948890695404494918","type":0,"content":"Playing the long game, basically","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:32:51.321000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948890733211975700","type":0,"content":"Open to advice, if course","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:33:00.335000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891120161652766","type":0,"content":"Well, I can tell you that bookers don't book anyone for paid spots that they haven't seen before. Typically they'll ask you to do a 'preview spot' which is a 10 minute spot (unpaid) where they will consider you for a paid spot. You might have to do two or more before they'll crack open their wallets","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:34:32.591000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891215754059786","type":0,"content":"They also don't have time to sit around watching a 20 minute video","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:34:55.382000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891430129127474","type":0,"content":"Instead, send two or three clips of key jokes with high energy and solid payoff preferably those clips should be sourced from different shows (as it speaks to versatility)","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:35:46.493000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891602456305674","type":0,"content":"Yeah, we call it an open spot here. I've got my honeymoon this month and then I'm hitting a fair few open spots around the country. Trying to get my name around where I can","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:36:27.579000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891638321774592","type":0,"content":"It will look better if the clips are from theaters rather than art centers and the like, as that speaks to the kind of bookings youre already getting","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:36:36.130000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891665324736512","type":0,"content":"No open spots are different","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:36:42.568000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891693971812372","type":0,"content":"OK, I'll film more sets in better places and make a highlight reel at some point","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:36:49.398000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891713307549736","type":0,"content":"Pro acts know to ask for a 'Preview Spot'","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:36:54.008000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948891781221736449","type":0,"content":"OK. I thought that was a US thing. Never heard that term before","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"em  Highlight and Glee, a few spots with Top Secret in London, all my 'open mics' were done at The Old Rope in Oxford Circus (as thats where all the pro's went to test their new material)","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:39:38.489000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948892459050606593","type":0,"content":"Are you using a writer?","channel_id":"842193547213144064","author":{"id":"331232519737442305","username":"m3dik8","avatar":"9e69c6afc51bdaefe4dd9547251e977d","avatar_decoration":null,"discriminator":"7625","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:39:51.807000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948892577472610344","type":0,"content":"Yeah I heard of that one. I don't know if that night still exists","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-03-03T10:40:20.041000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"948892637585354753","type":0,"content":"I don't. I write my own material, but have a gyg who helps me punch it up","channel_id":"842193547213144064","author":{"id":"537017225505144871","username":"WillPreston","avatar":"4a732e53097c1740e4e9469155e96b21","avatar_decoration":null,"discriminator":"4661","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[
