f holes theyre more ‚Äòloose knit grandma sweater‚Äô than roads‚Äù\n\n‚ÄúRenting an apartment is like having Netflix for shelter: you dont own anything, it seems to get more expensive every year, and the guy who owns it gets pissed off when you let 20 people use it at once‚Äù\n\n‚ÄúDo you think Mrs. T from Mrs. T‚Äôs pirogies is married to Mr. T from the A-Team? Do you think he pities the fool who doesn‚Äôt eat his wife‚Äôs pirogies?‚Äù  (That‚Äôs my most Pete Holmes style joke!)","channel_id":"842193547213144064","author":{"id":"443879469518815262","username":"dolandonline","avatar":"e9fecc43acd7f63f9f1b3a28f326e3a8","avatar_decoration":null,"discriminator":"4473","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-04-14T20:52:00.667000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"964267773620539462","type":0,"content":"‚ÄúI went to Rite Aid a couple of weeks ago and as the guy was bagging my items I noticed that the bags he was using were a lot sturdier than the bags they usually had. So, being a weirdo, I go ‚ÄòHey these bags are sturdier than usual!‚Äô And his eyes lit up like the cigarette of a mom in her mid 40s who needs a break. He was so excited to tell me about these bags. He goes ‚Äòwe‚Äôre not supposed to have these.‚Äô And i go ‚Äòwhy?‚Äô And he goes ‚Äòthey‚Äôre only supposed to be at the California stores, we got sent them by mistake‚Äô he sounded like i was interrogating him like ‚Äòwhere did you get the bags!?‚Äô And he‚Äôs like ‚ÄòThey fell off the back of a truck!‚Äô But he‚Äôs telling me that they weren‚Äôt supposed to be there but he wasnt going to tell anyone, and I looked him in the eyes and i said ‚ÄòI wont tell anyone either‚Äô then i walked out of the rite aid and told everyone! I went back in yesterday and saw a few of those bags around! So either they got a shit ton of them or he‚Äôs been rationing them for people he thinks are worthy. He must have found out I told, I haven‚Äôt gotten a sturdy bag since.‚Äù","channel_id":"842193547213144064","author":{"id":"443879469518815262","username":"dolandonline","avatar":"e9fecc43acd7f63f9f1b3a28f326e3a8","avatar_decoration":null,"discriminator":"4473","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-04-14T20:55:52.460000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"964276138769797160","type":0,"content":"https://youtube.com/playlist?list=PLwWgSTznIk3nMd1KQcdH-PlnqC-QUgUoT","channel_id":"842193547213144064","author":{"id":"693300367718481931","username":"Kaizen K (Leo) [he/him]","avatar":"b5078715c1cf9c47f8d76f938d518545","avatar_decoration":null,"discriminator":"3765","public_flags":64},"attachments":[],"embeds":[{"type":"link","url":"https://youtube.com/playlist?list=PLwWgSTznIk3nMd1KQcdH-PlnqC-QUgUoT","title":"Stand-up Comedy, Leonard BurcƒÉ","provider":{"name":"YouTube"},"thumbnail":{"url":"https://i.ytimg.com/vi/_HgUXwT5s28/hqdefault.jpg?sqp=-oaymwEWCKgBEF5IWvKriqkDCQgBFQAAiEIYAQ==&rs=AOn4CLCXEFUVx-SPmZwQ_MD8XDyUxDa7dg&days_since_epoch=19096","proxy_url":"https://images-ext-1.discordapp.net/external/pdaf8aL8MhoVe2M9Ty7_cI7nIVZNRaVkqCf1ckYnvWo/%3Fsqp%3D-oaymwEWCKgBEF5IWvKriqkDCQgBFQAAiEIYAQ%3D%3D%26rs%3DAOn4CLCXEFUVx-SPmZwQ_MD8XDyUxDa7dg%26days_since_epoch%3D19096/https/i.ytimg.com/vi/_HgUXwT5s28/hqdefault.jpg","width":168,"height":94}}],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-04-14T21:29:06.867000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"964276454156304464","type":0,"content":"After postponing to upload my material to YouTube for so long, I finally uploaded some individual jokes.\n<@215162686801969152> this is in part thanks to you, cause you kept asking when I'll do it üòÅ","channel_id":"842193547213144064","author":{"id":"693300367  by the Soviets, and you‚Äôre telling me people invited a radiation box into their houses. No fucking way. \nCan you imagine a microwave salesman then (old-timey voice here or smtn): ‚ÄúHey Bob you were in the war, you remember that thing we dropped on the Japs? Well how would you like to have the power of Hiroshima on YOUR kitchen counter?‚Äù \n\nLike how did anyone buy this? Microwaves are so much different from any other appliance safety-wise too you know? Like if I touch a hot stove or an oven it just kinda hurts but you‚Äôre usually fine. \nDo you know what happens if you put something living in a microwave? It fucking dies! Instantly and painfully! \n\nI have to say I only know that because of that weird emo kid in elementary school, we all know him, who would say shit to you like ‚ÄúI put my hamster in the microwave yesterday‚Äù \nAnd I can see him doing it too like (at this point its physical/sound comedy) *shutting microwave door, punching in numbers* ‚Äúmmmmmmm‚Äù nice pop sound into the mic","channel_id":"842193547213144064","author":{"id":"748736671566135306","username":"not.julian","avatar":"b263c452c9b318262222fdde3d6fde31","avatar_decoration":null,"discriminator":"5423","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-04-17T04:29:28.247000+00:00","edited_timestamp":"2022-04-17T04:29:40.365000+00:00","flags":0,"components":[]},{"id":"965106832311975947","type":0,"content":"i tried to do word for word as i best i could lol","channel_id":"842193547213144064","author":{"id":"748736671566135306","username":"not.julian","avatar":"b263c452c9b318262222fdde3d6fde31","avatar_decoration":null,"discriminator":"5423","public_flags":0},"attachments":[],"embeds":[],"mentions":[],"mention_roles":[],"pinned":false,"mention_everyone":false,"tts":false,"timestamp":"2022-04-17T04:29:59.641000+00:00","edited_timestamp":null,"flags":0,"components":[]},{"id":"965124930675015     document.querySelector('#server-icon').src = 'https://cdn.discordapp.com/icons/514967871823020053/a_364e0e5b31b4b2044d2190c9e71dd874.webp?size=96';

    let msg_list_container = document.querySelector('#chatlogs-message-list-container');
    messages.forEach(elmt => {
        let message_box = document.createElement('div');
        message_box.classList.add('message-box');

        let img_avatar = document.createElement('img');
        img_avatar.classList.add('message-avatar');
        img_avatar.width = '64';
        img_avatar.height = '64';
        img_avatar.src = get_avatar_url(elmt.author.id, elmt.author.avatar);
        message_box.appendChild(img_avatar);

        //message-body
        let message_body = document.createElement('div');
        message_body.classList.add('message-body');
        //message-meta
        let message_meta = document.createElement('div');
        message_meta.classList.add('message-meta');
        let message_author = document.createElement('span');
        message_author.classList.add('message-author');
        message_author.innerText = elmt.author.username + '#' + elmt.author.discriminator;
        let message_date = document.createElement('span');
        message_date.classList.add('message-date');
        let day = new Date(elmt.timestamp);
        message_date.innerText = `${day.toLocaleDateString()} ${day.toLocaleTimeString()}`;
        message_meta.appendChild(message_author);
        message_meta.appendChild(message_date);
        message_body.appendChild(message_meta);
        message_box.appendChild(message_body);

        //message-content
        let message_content = document.createElement('div');
        message_content.classList.add('message-content');
        let span_content = document.createElement('span');
        span_content.innerText = elmt.content;
        message_content.appendChild(span_content);
        message_body.appendChild(message_content);

        //message-embeded
        let message_embed = document.createElement('div');
        message_embed.classList.add('message-embeded');
        elmt.embeds.forEach(embed_elmt => {
            let embed_container = document.createElement('div');
            embed_container.classList.add('embed-container');
            message_embed.appendChild(embed_container);

            if (embed_elmt.title) {
                let embed_text = document.createElement('div');
                embed_text.classList.add('embed-text');
                embed_text.innerText = embed_elmt.title;
                embed_container.appendChild(embed_text);
            }

            if (embed_elmt.description) {
                let embed_desc = document.createElement('div');
                embed_desc.classList.add('embed-description');
                embed_desc.innerText = embed_elmt.description;
                embed_container.appendChild(embed_desc);
            }

            let embed_thumbnail = document.createElement('div');
            embed_thumbnail.classList.add('embed-thumbnail');
            let link = document.createElement('a');
            link.target = '_blank';
            if (embed_elmt.video) {
                link.href = embed_elmt.video.url;
            } else if (embed_elmt.image) {
                link.href = embed_elmt.image.url;
            }

            if (embed_elmt.thumbnail && embed_elmt.thumbnail.url) {
                let img_link = document.createElement('img');
                img_link.src = embed_elmt.thumbnail.url;
                link.appendChild(img_link);
                embed_thumbnail.appendChild(link);
                embed_container.appendChild(embed_thumbnail);
            }

            message_body.appendChild(message_embed);
        });

        //attachments
        let message_attach = document.createElement('div');
        elmt.attachments.forEach(attach_elmt => {
            let attach_container = document.createElement('div');
            attach_container.classList.add('attach-container');
            message_attach.appendChild(attach_container);

            let link = document.createElement('a');
            link.target = '_blank';
            if (['image/png', 'image/jpg', 'image/jpeg', 'image/gif'].includes(attach_elmt.content_type)) {
                let img_link = document.createElement('img');
                img_link.src = attach_elmt.url;

                link.appendChild(img_link);
                attach_container.appendChild(link);
            }

            message_body.appendChild(message_attach);
        });


        msg_list_container.appendChild(message_box);
    });
</script>
